import React, { useState, useEffect } from 'react';  
import CheckList from './components/checklist';

const ChecklistPage = () => {
    const [checklistsList, setChecklistsList] = useState()

    useEffect(() => {
        const fetchData = async () => {
            const result = await fetch(
                `/user/my-checklist`,
                {
                    method: 'GET',
                    headers: {
                        'Content-Type': 'application/json',
                        'token-backend': localStorage.getItem('myToken'),
                        'email-backend': localStorage.getItem('myEmail')
                    }   
                });
            const body = await result.json();
            console.log(body);
            setChecklistsList(body)
        }
        fetchData();
    },[])

    return(
        <>
        <p>My Checklists List</p>
        {/* {checklistsList.map((checklist, key) => (
            <CheckList key={key} part1={checklist.part1} part2={checklist.part2} part3={checklist.part3} />
        ))}   */}
        </>
    )
}

export default ChecklistPage
